## §⟨4⟩Pure Rust async await client for Apache Pulsar
This is a pure Rust client for Apache Pulsar that does not depend on the C++ Pulsar library. It provides an async/await based API, compatible with Tokio⟨5⟩ and async-std⟨6⟩.
Features:
  * URL based (`pulsar://` and `pulsar+ssl://`) connections with DNS lookup
  * multi topic consumers (based on a regex)
  * TLS connection
  * configurable executor (Tokio or async-std)
  * automatic reconnection with exponential back off
  * message batching
  * compression with LZ4, zlib, zstd or Snappy (can be deactivated with Cargo features)


### §⟨7⟩Examples
